import React from 'react';

const imageList = [
  {
    id: 1,
    name: 'Granada',
    url: 'data:image/jpeg;base64,'
  },
  {
    id: 2,
    name: 'BArcelo',
    url: 'data:image/jpeg;base64,'
  },
  {
    id: 3,
    name: 'San Juan del sur',
    url: 'data:image/jpeg;base64,'
  }
];

function ImageList() {
  const handleDownloadImage = async (imageUrl, imageName) => {
    try {
      const response = await fetch(imageUrl);
      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);

      const link = document.createElement('a');
      link.href = url;
      link.download = imageName;
      link.click();

      window.URL.revokeObjectURL(url);
      link.remove();
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const imageListItems = imageList.map(image => (
    <li key={image.id}>
      <img src={image.url} alt={image.name} />
      <button onClick={() => handleDownloadImage(image.url, image.name)}>Descargar</button>
    </li>
  ));

  return (
    <div>
      <h1>Lista de Imágenes</h1>
      <ul>{imageListItems}</ul>
    </div>
  );
}

export default ImageList;
